mmer noch an dich     You might also like    [Hook: Ufo361 & Paula Hartmann, Paula Hartmann ]  So viele Red Cups ( Mh-mh )     Heute bleib' ich high, solang ich Gas hab' ( Gas hab' )     Tut mir leid, Girl, wenn ich dich verletzt hab'  Auch wenn du was andres sagst  Ich hab' uns an die Wand gefahr'n  Scheiß drauf, kill' die ganze Bar  Red Cups    ( Red Cups )     Heute bleib' ich high, solang ich Gas hab'    ( Gas hab' )     Tut mir leid, Girl, wenn ich dich verletzt hab' ( Mh-mhh )  Auch wenn du was andres sagst  Ich hab' uns an die Wand gefahr'n  Was hab' ich uns angetan?   [Part 2: Paula Hartmann]  Red Cups, seit du weg bist (Ah)     Hatten Clean Cut, aber fühl' mich dreckig (Mh)     Mach' ich auf, gibt das Leben 'ne Bombe  Ich bin ein scheiß Schneemann, verliebt in die Sonne (Sonne; mh)  Sitze nachts im 104er, Handtasche, 'ne Zip-Bag  All Acne black, Eazy's L.A. Kings cap  Drei verpasste Anrufe, ich drück' dich weg  Doch kaue drauf rum – Big Red  Doch ich brenne nicht (Doch ich brenne nicht)  Wir zerbrechen ganz leise  Kein Klang, wenn's zu Ende ist (Wenn's zu Ende ist)  Ich denk' an dich      [Hook: Ufo361 & Paula Hartmann, Ufo361 , Paula Hartmann ]  So viele Red Cups ( Ja-ja-ja )     Heute bleib' ich high, solang ich Gas hab' ( So viele Red Cups, ja, ja-ja, Stay High )     Tut mir leid, Girl, wenn ich dich verletzt hab' ( Ja, tut mir leid, ja-ja )  Auch wenn du was andres sagst ( Ja-ja, ja-ja )  Ich hab' uns an die Wand gefahr'n ( Ja-ja, so viele )  Scheiß drauf, kill' die ganze Bar ( So viele, so viele )  Red Cups ( Ja, Red Cups ; Red Cups )     Heute bleib' ich high, solang ich Gas hab' ( 'Nur Für Dich 2', Stay High ; Gas hab' )     Tut mir leid, Girl, wenn ich dich verletzt hab' ( Ja, ja, ja, ja, ja, ja, Stay High ; mh-mh )  Auch wenn du was andres sagst ( Ja, ja, ja, Stay High ; mh-mh )  Ich hab' uns an die Wand gefahr'n ( Ja, ja, ja , mh-mh )  Was hab' ich uns angetan?      Embed  Cancel How to Format Lyrics: Type out all lyrics, even repeating song parts