2920393],\"body\":{\"html\":\"[Songtext zu „RED CUPS“]\\n\\n[Intro: Paula Hartmann & Ufo361<\/i>]\\nMhh-mhh-mh\\nMhh-mhh-mh\\nMhh-mhh-mh\\nEy, ihr wisst Bescheid<\/i> (Jimmy<\/b>)\\n\\n[Hook: Ufo361, Ufo361 & Paula Hartmann<\/i>, Paula Hartmann<\/b>]\\nSo viele Red Cups (Mh-mh<\/b>)<\/a>\\nHeute bleib\' ich high, solang ich Gas hab\' (Mh, mh<\/b>)<\/a>\\nTut mir leid, Girl, wenn ich dich verletzt hab\'\\nAuch wenn du was andres sagst\\nIch hab\' uns an die Wand gefahr\'n\\nScheiß drauf, kill\' die ganze Bar\\nRed Cups<\/a><\/i> (Red Cups<\/b>)<\/a>\\nHeute bleib\' ich high, solang ich Gas hab\'<\/a><\/i> (Gas hab\'<\/b>)<\/a>\\nTut mir leid, Girl, wenn ich dich verletzt hab\'\\nAuch wenn du was andres sagst\\nIch hab\' uns an die Wand gefahr\'n\\nWas hab\' ich uns angetan?<\/i> (Ihr wisst Bescheid)\\n\\n[Part 1: Ufo361, Ufo361 & Paula Hartmann<\/i>, Paula Hartmann<\/b>]\\nAls ob das irgendwas bringt\\nIch würde sagen: „Mir geht\'s gut“, aber das würde nicht stimm\'n\\nAlles drеht sich, guck\' mich um und ich weiß nicht, wo ich bin\\nIch weiß nur, wenn dis Glas nicht rеicht, Mann, dann das nächste bestimmt (Mh-mh-mh<\/i>)\\nYamazaki, kein Jacky\\nJa, ich nehm\' noch ein\'n Schluck<\/i> (Ein\'n Schluck<\/b>)\\nDreißig Gramm in ei\'m Baggie<\/i><\/a>\\nShibuya riecht nach mei\'m Kush (Mei\'m Kush<\/b>)\\nUnd auch bisschen nach dir<\/i> (Nach dir<\/b>)\\nWarum bist du nicht hier?<\/i> (Nicht hier<\/b>)\\nEgal, wie weit es mich wegzieht<\/i> (Ja; mh<\/b>)\\nÜberall ist dein Duft<\/i>\\nWas du für mich warst und was du heute für mich bist\\nKann ich selber nicht gut sagen (Mh<\/b>), weiß nur, dass da noch was ist (Mh, mh<\/b>)\\nAber Liebe ist es nicht, weil mein Herz ist zu gefickt (Nah<\/b>)\\nAber trotzdem denk\' ich, wenn ich drunk bin, immer noch an dich\\n\\n[Hook: Ufo361 & Paula Hartmann, Paula Hartmann<\/i>]\\nSo viele Red Cups (Mh-mh<\/i>)<\/a>\\nHeute bleib\' ich high, solang ich Gas hab\' (Gas hab\'<\/i>)<\/a>\\nTut mir leid, Girl, wenn ich dich verletzt hab\'\\nAuch wenn du was andres sagst\\nIch hab\' uns an die Wand gefahr\'n\\nScheiß drauf, kill\' die ganze Bar\\nRed Cups<\/a> (Red Cups<\/i>)<\/a>\\nHeute bleib\' ich high, solang ich Gas hab\'<\/a> (Gas hab\'<\/i>)<\/a>\\nTut mir leid, Girl, wenn ich dich verletzt hab\' (Mh-mhh<\/i>)\\nAuch wenn du was andres sagst\\nIch hab\' uns an die Wand gefahr\'n\\nWas hab\' ich uns angetan?\\n\\n[Part 2: Paula Hartmann]\\nRed Cups, seit du weg bist (Ah)<\/a>\\nHatten Clean Cut, aber fühl\' mich dreckig (Mh)<\/a>\\nMach\' ich auf, gibt das Leben \'ne Bombe\\nIch bin ein scheiß Schneemann, verliebt in die Sonne (Sonne; mh)\\nSitze nachts im 104er, Handtasche, \'ne Zip-Bag\\nAll Acne black, Eazy\'s L.A. Kings cap\\nDrei verpasste Anrufe, ich drück\' dich weg\\nDoch kaue drauf rum – Big Red\\nDoch ich brenne nicht (Doch ich brenne nicht)\\nWir zerbrechen ganz leise\\nKein Klang, wenn\'s zu Ende ist (Wenn\'s zu Ende ist)\\nIch denk\' an dich\\n\\n[Hook: Ufo361 & Paula Hartmann, Ufo361<\/i>, Paula Hartmann<\/b>]\\nSo viele Red Cups (Ja-ja-ja<\/i>)<\/a>\\nHeute bleib\' ich high, solang ich Gas hab\' (So viele Red Cups, ja, ja-ja, Stay High<\/i>)<\/a>\\nTut mir leid, Girl, wenn ich dich verletzt hab\' (Ja, tut mir leid, ja-ja<\/i>)\\nAuch wenn du was andres sagst (Ja-ja, ja-ja<\/i>)\\nIch hab\' uns an die Wand gefahr\'n (Ja-ja, so viele<\/i>)\\nScheiß drauf, kill\' die ganze Bar (So viele, so viele<\/i>)\\nRed Cups (Ja, Red Cups<\/i>; Red Cups<\/b>)<\/a>\\nHeute bleib\' ich high, solang ich Gas hab\' (\'Nur Für Dich 2\', Stay High<\/i>; Gas hab\'<\/b>)<\/a>\\nTut mir leid, Girl, wenn ich dich verletzt hab\' (Ja, ja, ja, ja, ja, ja, Stay High<\/i>; mh-mh<\/b>)\\nAuch wenn du was andres sagst (Ja, ja, ja, Stay High<\/i>; mh-mh<\/b>)\\nIch hab\' uns an die Wand gefahr\'n (Ja, ja, ja<\/i>, mh-mh<\/b>)\\nWas hab\' ich uns angetan?<\/p>\\n\\n\",\"children\":[{\"children\":[\"[Songtext zu „RED CUPS“]\",{\"tag\":\"br\"},\"\",{\"tag\":\"br\"},\"[Intro: Paula Hartmann & \",{\"children\":[\"Ufo36